const Maps = () => {
  return (
    <div>
        <script src="mapscipt.js"></script>
        <div class ="maps">
        <div class = "topMap">
            <div id="map1"></div>
            <div id="map2"></div>
            <div id="map3"></div>
        </div>
        <div class = "botMap">
            <div id="map4"></div>
        </div>
        </div>
    </div>
  );
};

export default Maps;
